import React from 'react'
import {MdOutlineCopyright} from "react-icons/md";
import './Footer.css'

const Footer = () => {
  return (
    <footer className='footer'>
    <h2 className='footertitle'><span>Uwindsor</span>Healthify</h2>    
    <div className='footerbody'><h2 className='footerdesc'><MdOutlineCopyright className='img'/>UwindsorHealthify.ai</h2> </div>
    </footer>
  )
}
export default Footer
